import React from 'react'
import { primary } from '../../styles'

const Header = () => (
  <div className='header-container'>
    <div className='icon-container'>
      <img
        src='https://res.cloudinary.com/df0ll615k/image/upload/v1559521852/reactSubduedLogo.png'
        alt='logo'
        className='icon'
      />
    </div>

    <style jsx>{`
      .header-container {
        height: 30rem;
        background-color: ${primary};
      }
      .icon-container {
        text-align: center;
      }
      .icon {
        opacity: 0.8;
        display: inline-block;
      }
      body {
        margin: 0 !important;
        text-align: center;
      }
    `}</style>
  </div>
)
export default Header
